/* Drops all Tables */

DROP TABLE Reviews;
DROP TABLE Makes;
DROP TABLE Orders;
DROP TABLE Staff;
DROP TABLE Staffs;
DROP TABLE Sells;
DROP TABLE Restaurants;
DROP TABLE Food;
DROP TABLE Promotions;
DROP TABLE CreditCard;
DROP TABLE Customers;
DROP TABLE PartTimer;
DROP TABLE FullTimer;
DROP TABLE MaintainsPT;
DROP TABLE MaintainsFT;
DROP TABLE Riders;
DROP TABLE Managers;
DROP TABLE PostalDistrict;

/* Create all Tables */

CREATE TABLE Customers (
	cid 		    SERIAL,
	cname			VARCHAR(60),
    contact         INTEGER,
    rewardpoints    INTEGER,
	PRIMARY KEY (cid)
);

CREATE TABLE Restaurants (
	rid 			SERIAL,
	rname 		    VARCHAR(60),
    raddress        VARCHAR(300),
	minOrder        INTEGER,  
	PRIMARY KEY (rid)
);

CREATE TABLE Food (
	foodid 			SERIAL,
    fname           VARCHAR(20),
	category 		VARCHAR(20),
    amountOrdered   INTEGER,
    orderLimit      INTEGER,
    price           FLOAT,
    available       BOOLEAN,
	PRIMARY KEY (foodid)
);

CREATE TABLE Promotions (
	promoid 		SERIAL,
    pname           VARCHAR(60),
    discount        FLOAT,
    StartDateTime   TIMESTAMP,
    EndDateTime     TIMESTAMP,
	PRIMARY KEY (promoid)
);

CREATE TABLE Managers (
	mid 			SERIAL,
	mname           VARCHAR(60),
	PRIMARY KEY (mid)
);

CREATE TABLE Riders (
	riderid 		SERIAL,
	riderName       VARCHAR(60),
	vnumber         VARCHAR(10),
	mid 			INTEGER not null,
	PRIMARY KEY (riderid),
	FOREIGN KEY (mid) references Managers
);

CREATE TABLE Orders (
	orderid 		SERIAL,
	postalcode		VARCHAR(6),
	dlocation		VARCHAR(200),
	orderTime       TIMESTAMP,
    assignTime      TIMESTAMP,
    arrivalTime     TIMESTAMP,
    departTime      TIMESTAMP,
    deliveryTime    TIMESTAMP,
    deliveryFee     FLOAT,
    totalCost       FLOAT,
    rid 			INTEGER not null,
    riderid			INTEGER not null,
	PRIMARY KEY (orderid),
	FOREIGN KEY (rid) references Restaurants,
	FOREIGN KEY (riderid) references Riders
);

CREATE TABLE Reviews (
	reviewid 		SERIAL,
    foodRating      INTEGER,
    foodReview      VARCHAR(1000),
    deliveryRating  INTEGER,
    deliveryReview  VARCHAR(1000),
    cid 			INTEGER,
    orderid			INTEGER,
	PRIMARY KEY (reviewid),
	FOREIGN KEY (cid) references Customers on delete cascade,
	FOREIGN KEY (orderid) references Orders on delete cascade
);

CREATE TABLE Staff (
	staffid			SERIAL,
    sname           VARCHAR(60),
    rid    			INTEGER not null,
	PRIMARY KEY (staffid),
	FOREIGN KEY (rid) references Restaurants
);

CREATE TABLE PartTimer (
	riderid 		INTEGER,
	WeeklyBaseSalary  FLOAT,
	PRIMARY KEY (riderid),
	FOREIGN KEY (riderid) references Riders on delete cascade
);

CREATE TABLE FullTimer (
	riderid 		INTEGER,
	MonthlyBaseSalary FLOAT,
	PRIMARY KEY (riderid),
	FOREIGN KEY (riderid) references Riders on delete cascade
);

CREATE TABLE CreditCard (
	cardid			SERIAL,
	cardnumber		VARCHAR(20),
	cid 			INTEGER not null,
	PRIMARY KEY (cardid),
	FOREIGN KEY (cid) references Customers on delete cascade
);

CREATE TABLE MaintainsPT (
	day				VARCHAR(10),
	StartTime       TIMESTAMP,
	EndTime 		TIMESTAMP,
	riderid			INTEGER,
	FOREIGN KEY (riderid) references Riders on delete cascade
);

CREATE TABLE MaintainsFT (
	Month 			VARCHAR(10),
	Year			INTEGER,
	StartDay		VARCHAR(10),
	Shift			INTEGER,
	riderid			INTEGER,
	FOREIGN KEY (riderid) references Riders on delete cascade
);

CREATE TABLE Makes (
	cid 			INTEGER,
	orderid			INTEGER,
	foodid			INTEGER,
	amount          INTEGER,
	FOREIGN KEY (cid) references Customers,
	FOREIGN KEY (orderid) references Orders,
	FOREIGN KEY (foodid) references Food
);

CREATE TABLE Sells (
	foodid			INTEGER,
	promoid			INTEGER,
	rid 			INTEGER,
	PRIMARY KEY (foodid),
	FOREIGN KEY (foodid) references Food,
	FOREIGN KEY (promoid) references Promotions,
	FOREIGN KEY (rid) references Restaurants
);

CREATE TABLE PostalDistrict (
	district	VARCHAR(2),
	sector		VARCHAR(2),
	PRIMARY KEY (district,sector)
);

